import Navbar from "./component/Navbar";
import Main from "./component/arithmetic/Main";
import SharedProvider from './utils/SharedContext'


function App() {
  return (
    <div className="App">
      <SharedProvider>
       <Navbar/>
       <Main/>
       </SharedProvider>
    </div>
  );
}

export default App;
